                      children: [/*#__PURE__*/_jsxDEV(Tab.Pane, {
                        eventKey: "#link1",
                        children: "\u0987\u09B6\u09A4\u09BF\u09DF\u09BE\u0995 \u09B9\u09BE\u09B8\u09BE\u09A8 \u09E7\u09EB \u09AB\u09C7\u09AC\u09CD\u09B0\u09C1\u09AF\u09BC\u09BE\u09B0\u09BF \u09E8\u09E6\u09E8\u09E8, \u09E8\u09E6:\u09E8\u09E8 \u0987\u09A8\u09B8\u09CD\u099F\u09BE\u0997\u09CD\u09B0\u09BE\u09AE\u09C7\u09B0 \u09B8\u09CD\u099F\u09CB\u09B0\u09BF\u09A4\u09C7 \u09AA\u09CD\u09B0\u09BE\u0987\u09AD\u09C7\u099F \u09B2\u09BE\u0987\u0995 \u09AA\u09BE\u09A0\u09BE\u09A8\u09CB \u09AF\u09BE\u09AC\u09C7 \u09A8\u09A4\u09C1\u09A8 \u09AB\u09BF\u099A\u09BE\u09B0 \u09AF\u09C1\u0995\u09CD\u09A4 \u0995\u09B0\u09BE \u09B9\u09B2\u09CB \u0987\u09A8\u09B8\u09CD\u099F\u09BE\u0997\u09CD\u09B0\u09BE\u09AE\u09C7\u09B0 \u09B8\u09CD\u099F\u09CB\u09B0\u09BF\u09A4\u09C7\u0964 \u098F\u0996\u09A8 \u09A5\u09C7\u0995\u09C7 \u0995\u09C7\u0989 \u0995\u09CB\u09A8\u0993 \u09AD\u09BF\u09A1\u09BF\u0993 \u09AC\u09BE \u099B\u09AC\u09BF \u09B6\u09C7\u09DF\u09BE\u09B0 \u0995\u09B0\u09B2\u09C7, \u09B8\u09C7\u0996\u09BE\u09A8\u09C7 \u09AA\u09CD\u09B0\u09BE\u0987\u09AD\u09C7\u099F \u09B2\u09BE\u0987\u0995 \u09AA\u09BE\u09A0\u09BE\u09A8\u09CB \u09AF\u09BE\u09AC\u09C7\u0964 \u098F\u09B0 \u0986\u0997\u09C7 \u0995\u09CB\u09A8\u0993 \u09B8\u09CD\u099F\u09CB\u09B0\u09BF\u09A4\u09C7 \u09AA\u09CD\u09B0\u09A4\u09BF\u0995\u09CD\u09B0\u09BF\u09DF\u09BE \u09A6\u09C7\u0996\u09BE\u09A4\u09C7 \u099A\u09BE\u0987\u09B2\u09C7 \u0989\u09AA\u09BE\u09DF \u099B\u09BF\u09B2 \u09B6\u09C1\u09A7\u09C1\u2014 \u09B8\u09B0\u09BE\u09B8\u09B0\u09BF \u09AE\u09C7\u09B8\u09C7\u099C \u09AA\u09BE\u09A0\u09BE\u09A8\u09CB, \u0985\u09A5\u09AC\u09BE \u0987\u09AE\u09CB\u099C\u09BF \u09B0\u09BF\u0985\u09CD\u09AF\u09BE\u0995\u09B6\u09BE\u09A8\u0964 \u09A8\u09A4\u09C1\u09A8 \u098F\u0987 \u09AB\u09BF\u099A\u09BE\u09B0\u09C7 \u09B8\u09C7\u09A8\u09CD\u09A1 \u09AE\u09C7\u09B8\u09C7\u099C \u098F\u09AC\u0982 \u0985\u09CD\u09AF\u09BE\u09B0\u09CB\u09AA\u09CD\u09B2\u09C7\u09A8 \u0986\u0987\u0995\u09A8\u09C7\u09B0 \u09AE\u09BE\u099D\u09C7 \u09A8\u09A4\u09C1\u09A8 \u098F\u0995\u099F\u09BF \u09B9\u09BE\u09B0\u09CD\u099F \u0986\u0987\u0995\u09A8 \u09AA\u09BE\u0993\u09DF\u09BE \u09AF\u09BE\u09AC\u09C7\u0964 \u098F\u0987 \u0986\u0987\u0995\u09A8\u09C7 \u09B2\u09BE\u0987\u0995 \u09A6\u09BF\u09B2\u09C7 \u09B8\u09C7\u099F\u09BF \u09AA\u09CB\u09B8\u09CD\u099F\u09A6\u09BE\u09A4\u09BE\u09B0 \u0995\u09BE\u099B\u09C7 \u09AA\u09CC\u0981\u099B\u09BE\u09AC\u09C7 \u09A0\u09BF\u0995\u0987, \u0995\u09BF\u09A8\u09CD\u09A4\u09C1 \u0985\u09A8\u09CD\u09AF\u09B0\u09BE \u09B8\u09C7\u099F\u09BE \u09A6\u09C7\u0996\u09A4\u09C7 \u09AA\u09BE\u09B0\u09AC\u09C7 \u09A8\u09BE\u0964 \u0987\u09A8\u09B8\u09CD\u099F\u09BE\u0997\u09CD\u09B0\u09BE\u09AE\u09C7\u09B0 \u09AA\u09CD\u09B0\u09A7\u09BE\u09A8 \u0985\u09CD\u09AF\u09BE\u09A1\u09BE\u09AE \u09AE\u09CB\u09B8\u09C7\u09B0\u09BF \u09AC\u09B2\u09C7\u09A8, \u2018\u098F\u09AE\u09A8 \u098F\u0995\u099F\u09BF \u0985\u09AA\u09B6\u09A8 \u099A\u09BE\u09B2\u09C1 \u0995\u09B0\u09BE \u09B9\u09DF\u09C7\u099B\u09C7 \u09AC\u09CD\u09AF\u09AC\u09B9\u09BE\u09B0\u0995\u09BE\u09B0\u09C0\u09A6\u09C7\u09B0 \u098F\u0995\u09C7 \u0985\u09AA\u09B0\u09C7\u09B0 \u09AA\u09CD\u09B0\u09A4\u09BF \u09B8\u09B9\u09AF\u09CB\u0997\u09BF\u09A4\u09BE\u09B0 \u0995\u09CD\u09B7\u09C7\u09A4\u09CD\u09B0\u0995\u09C7 \u0986\u09B0\u0993 \u09AA\u09CD\u09B0\u09B8\u09BE\u09B0\u09BF\u09A4 \u0995\u09B0\u09A4\u09C7\u0964 \u09B8\u09C7\u0987 \u09B8\u0999\u09CD\u0997\u09C7 \u09B8\u09B0\u09BE\u09B8\u09B0\u09BF \u09AA\u09BE\u09A0\u09BE\u09A8\u09CB \u09AE\u09C7\u09B8\u09C7\u099C\u09C7\u09B0 \u099D\u09BE\u09AE\u09C7\u09B2\u09BE \u0995\u09AE\u09BE\u09A4\u09C7\u0993 \u098F\u099F\u09BF \u0995\u09B0\u09BE \u09B9\u09DF\u09C7\u099B\u09C7\u0964\u2019 \u09A4\u09BF\u09A8\u09BF \u0986\u09B0\u0993 \u09AC\u09B2\u09C7\u09A8, \u2018\u09AE\u09C7\u09B8\u09C7\u099C \u0986\u09AE\u09BE\u09A6\u09C7\u09B0 \u09AE\u09C2\u09B2 \u0985\u0997\u09CD\u09B0\u09BE\u09A7\u09BF\u0995\u09BE\u09B0 \u09B9\u09BF\u09B8\u09C7\u09AC\u09C7 \u09A5\u09BE\u0995\u09C7\u0964\u2019 \u098F\u09A8\u0997\u09C7\u099C\u09C7\u099F \u099C\u09BE\u09A8\u09BE\u09DF, \u0987\u09A8\u09B8\u09CD\u099F\u09BE\u0997\u09CD\u09B0\u09BE\u09AE \u098F\u09AE\u09A8 \u099B\u09CB\u099F \u099B\u09CB\u099F \u0985\u09A8\u09C7\u0995 \u0995\u09BE\u09B0\u09CD\u09AF\u0995\u09B0\u09C0 \u09AB\u09BF\u099A\u09BE\u09B0 \u099A\u09BE\u09B2\u09C1 \u0995\u09B0\u09C7\u099B\u09C7\u0964 \u0997\u09A4 \u09B6\u09B0\u09CE\u0995\u09BE\u09B2\u09C7 \u09AC\u09BE\u09B2\u09CD\u0995 \u09AE\u09C7\u09B8\u09C7\u099C \u098F\u09AC\u0982 \u09AD\u09BF\u09A1\u09BF\u0993 \u09A1\u09BF\u09B2\u09BF\u099F \u0995\u09B0\u09BE\u09B0 \u0985\u09AA\u09B6\u09A8 \u099A\u09BE\u09B2\u09C1 \u0995\u09B0\u09C7 \u09AA\u09CD\u09B0\u09A4\u09BF\u09B7\u09CD\u09A0\u09BE\u09A8\u099F\u09BF\u0964"
